import math

def Powerful(n):
    while (n%2==0):
        i=0
        while (n%2==0):
            n=n//2
            i=i+1
        if (i==1):
            return False
    for power in range(3, int(math.sqrt(n))+1, 2):
        i=0
        while (n%power==0):
            n=n//power
            i=i+1
        if (i==1):
            return False
    return (n==1)

